import props from "../data/data"
import RealEstat from "./real-estat"
let pageNum=0;
function setbuttons(){
   let list=[];
    for (let i = 0; i < props.length/8; i++) {
            list.push(
                <button key={i} onClick={changePageNum(i)}>{i}</button>
            )
    }
    return list;

}
function changePageNum(i){
    pageNum=i*9;
}

const Home = () => (
    <div className="display">
        <div className="proportes">{
        props.slice(pageNum,pageNum+9).map(item=>{
            return(
                <div className="item" >
            <RealEstat key={item.id} item={item}></RealEstat>
            
            </div>
                )
        })}
        </div >
        <div className="buttonsGroup">
           
        {setbuttons()}

        </div>
     <style jsx>{`
                .display{
                    display:flex;
                    flex-direction:column;
                }
                .pageButtons Button{
                    margin-right:3%;
                    min-width:30px;
                    min-height:50px;
                }
                .buttonsGroup{
                    display:flex;
                    flex-direction:row;
                    margin-left:auto;
                    margin-right:auto;
                    margin-top :3%;
                    margin-bottom:2%;
                }

                  .proportes{
                  overflow:auto;
                  display: flex;
                  max-width:92%;
                  margin-right:auto;
                  margin-left:auto;
                  margin-top:3%;
                  flex-direction: row;
                  flex-wrap: wrap;
                  justify-content: space-around;
                  width:100%
                  }
                  .item{
                    width:24%
                  }
                  
                  @media only screen and (max-width: 700px) {
                    .main-flex{
                      width: 100%;
                      display: flex;
                      flex-direction: column;
                  
                    }
                  
                    .flexitems{
                      max-width: 99vw;
                      min-width: 99vw;
                  
                    }
                    .search-container{
                      min-width: 50%;
                      max-width: auto;
                      display: flex;
                      flex-direction: row;
                      justify-content: space-around;
                      margin-right: auto;
                      margin-left: auto;
                    }
                    app-search{
                      width: 100%;
                    float: right;
                    }
                    .container{
                      margin-top: 0;
                    }
                  }
                  @media only screen and (max-width: 700px) {
                    .filters{
                      font-size: 1vw;
                    }
                  .item{
                    width: 45%;
                    margin-left: 2%;
                  }
                  
                  }
                  @media only screen and (min-width: 2000px) {
                  
                    .item{
                      width: 350px !important;
                      margin-left: 2%;
                    }
                  
                    }
                  
                  
                  
                
                ` }
                
            </style>
    </div>
 
)

   
  export default Home;
